import React , { Component } from "react";
import Slider from "react-slick";
import ContentSlideShow from "./ContentSlideShow";
import ImageSlideShow from "./ImageSlideShow";

export default class Quotes extends Component {
  render() {
    const slideQuotesSingle = {
      autoplay: true,
      autoplaySpeed: 2000,
      arrows: false,
      dots: true,
      autoplay: true,
    }
    return (
      <div className='single-item'>
      <Slider {...slideQuotesSingle} >
          <div>
            <ImageSlideShow />
            <ContentSlideShow />
          </div>
          <div>
            <ImageSlideShow />
            <ContentSlideShow />
          </div>
          <div>
            <ImageSlideShow />
            <ContentSlideShow />
          </div>
        </Slider>
      </div>
    )
  } 
}
